import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { BASE_URL } from '../../lib/constant'
import Post from '../Post/Post'
import "./Feed.css"

function Feed() {
    const [post, setPost] = useState([])
    const getPost = async () => {
        try {
            const res = await axios.get(`${BASE_URL}/post/timeline`)
            setPost(res.data)

        } catch (err) {
            console.log(err)
        }
    }
    useEffect(() => {
        getPost()
    }, [])
    return (
        <div className='feed'>
            <div class="row">
                <Post />
                <Post />

            </div>
        </div>
    )
}

export default Feed
